INSERT INTO `SERVMASK_PREFIX_posts` VALUES ('1827','1','2018-04-27 06:23:01','2018-04-27 06:23:01','A CRITERIA FOR EFFICIENT OPERATION consists of two activities.\r\n<p style=\"padding-left: 30px;\">The first ACTIVITY is of kind CHECK and will be performed on a regular basis.</p>\r\n<p style=\"padding-left: 30px;\">The second ACTIVITY is the appropriate activity that shall take place if the check reveals that the parameters are no longer in the desired range.</p>\r\nExample:\r\n<p style=\"padding-left: 30px;\">The first activity is to check if a heat exchanger is fouled (indicator is temperature after heat exchanger). The second activity is the cleaning of the heat exchanger.</p>','Create criteria for efficient operation','','publish','closed','closed','','create-criteria-for-efficient-operation','','','2018-10-10 16:19:40','2018-10-10 10:49:40','','0','http://192.168.0.61/maintenance_new/?page_id=1827','0','page','','0');
